import React from "react";
import { useState } from "react";

function CreateProduct() {
	const [name, setName] = useState("OG");

	return (
		<form>
			<label htmlFor="name">name</label>
			<input
				type="text"
				id="name"
				name="name"
				placeholder="name"
				value={name}
				onChange={(e) => e.target.value}
			/>
		</form>
	);
}

export default CreateProduct;
